    def switch_case_for_special_char(self):
        
        self.specialchar_mode = not self.specialchar_mode
        if self.specialchar_mode:
             self.frame_3.show()
        else:
             self.frame_3.hide()
             self.small_latter()  
    def switch_case_for_capital_char(self):
        self.uppercase_mode = not self.uppercase_mode
        
        if self.uppercase_mode:
             self.capital_latter()    
        else:
             self.small_latter()     
       
                   
    def delete_character(self, lineEdit):
        
        cursor_position = lineEdit.cursorPosition() 
        if lineEdit is None:
             print("Invalid line edit type")
             return
        if cursor_position != 0:
                lineEdit.setText(lineEdit.text()[:cursor_position - 1] + lineEdit.text()[cursor_position:])
                lineEdit.setCursorPosition(cursor_position - 1)
        else:
                print("Cursor index is 0 can not delete the text please enter the text to delete")
    def on_button_clicked(self):
        for button in (self.buttons()):
             button.clicked.connect(lambda _, value=str(button.text()): self.set_value_to_lineEdit(self.line_edit, value.upper() if self.uppercase_mode else value.lower() ))  
        for special_button in (self.special_char_buttons()):
             special_button.clicked.connect(lambda _, value=str(special_button.text()): self.set_value_to_lineEdit(self.line_edit, value.upper() if self.uppercase_mode else value.lower() ))
                   

    def set_value_to_lineEdit(self, lineEdit, value):
        # print("button text value :", value)
        
        if lineEdit is None:
             print("Invalid Line Edit")
             return
        cursor_position = lineEdit.cursorPosition() 
        # print(cursor_position, "cursor")
        lineEdit.setText(str(lineEdit.text()[:cursor_position]) + str(value) + str(lineEdit.text()[cursor_position:])) 
        lineEdit.setCursorPosition(cursor_position + 1)
        

